import * as React from 'react';
import PropTypes from 'prop-types';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import CssBaseline from '@mui/material/CssBaseline';
import Divider from '@mui/material/Divider';
import Drawer from '@mui/material/Drawer';
import IconButton from '@mui/material/IconButton';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import MenuIcon from '@mui/icons-material/Menu';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import classes from "./NavBar.module.css"
import GitHubIcon from '@mui/icons-material/GitHub';
import LinkedInIcon from '@mui/icons-material/LinkedIn';

const icons=[ <GitHubIcon href="https://github.com/sosenkkk" />, <LinkedInIcon href="https://www.linkedin.com/in/shashank-raj-5bb2a11b6/" />]

const drawerWidth = 240;
const navItems = ['Resume', 'About', 'Home'];

function DrawerAppBar(props) {
	const { window } = props;
	const [mobileOpen, setMobileOpen] = React.useState(false);

	const handleDrawerToggle = () => {
		setMobileOpen((prevState) => !prevState);
	};

	const drawer = (
		<Box onClick={handleDrawerToggle} sx={{ textAlign: 'center', color: "#28c6ed" }}>
								<AdbIcon sx={{ display: { xs: 'none', md: 'flex' }, mr: 1, color:"#28c6ed" }} />

			<Typography variant="h6" sx={{ my: 2 }}>
				Sosenk
			</Typography>
			<Divider />
			<List>
				{navItems.map((item) => (
					<ListItem key={item} disablePadding>
						<ListItemButton sx={{ textAlign: 'center', border: "1px solid #28c6ed", borderLeft: "none", borderRight: "NONE" }}>
							<ListItemText primary={item} />
						</ListItemButton>
					</ListItem>
				))}
				{icons.map((item) => (
					<ListItem key={Math.random().toString()} disablePadding>
						<ListItemButton sx={{ textAlign: 'center', border: "1px solid #28c6ed", borderLeft: "none", borderRight: "NONE" }}>
							<ListItemText primary={item} />
						</ListItemButton>
					</ListItem>
				))}
			</List>
		</Box>
	);

	const container = window !== undefined ? () => window().document.body : undefined;

	return (
		<Box sx={{ display: 'flex' }}>
			<CssBaseline />
			<AppBar component="nav" sx={{ backgroundColor: "black", color: "#28c6ed", padding:"6px 10%", borderBottom:"1px solid #28c6ed" }}  >
				<Toolbar  >
					<IconButton
						color="inherit"
						aria-label="open drawer"
						edge="start"
						onClick={handleDrawerToggle}
						sx={{ mr: 2, display: { sm: 'none' } }}
					>
						<MenuIcon />
					</IconButton>
					<Typography
						variant="h5"
						href='/'
						sx={{
							fontFamily: 'monospace',
							fontWeight: 700,
							letterSpacing: '.2rem',
							textDecoration: 'none', color: '#28c6ed', flexGrow: 1, display: { xs: 'none', sm: 'block' },
						}}
					>
						<div  className={classes.logo_butt} >Sosenk</div>
					</Typography>
					<Box sx={{ display: { xs: 'none', sm: 'block' } }}>
						{navItems.map((item) => (
							<Button key={item} sx={{ color: '#28c6ed', padding:"6px" }}>
								{item}
							</Button>
						))}
						{icons.map((item) => (
							<Button key={Math.random().toString()} sx={{ padding:"6px", color: '#28c6ed' }}>
								{item}
							</Button>
						))}
					</Box>
				</Toolbar>
			</AppBar>
			<Box component="nav" sx={{ backgroundColor: "black" }} >
				<Drawer
					container={container}
					variant="temporary"
					open={mobileOpen}
					onClose={handleDrawerToggle}
					ModalProps={{
						keepMounted: true, // Better open performance on mobile.
					}}
					sx={{
						display: { xs: 'block', sm: 'none' },
						'& .MuiDrawer-paper': { boxSizing: 'border-box', width: drawerWidth, backgroundColor: 'black' },
					}}
				>
					{drawer}
				</Drawer>
			</Box>
		</Box>
	);
}

DrawerAppBar.propTypes = {
	/**
	 * Injected by the documentation to work in an iframe.
	 * You won't need it on your project.
	 */
	window: PropTypes.func,
};

export default DrawerAppBar;
